aber. Where Kenobi‚Äôs feet were kicking the air as hard as he could, now reduced to just feeble punts as he immediately dropped to the ground. Palpatine head first into the wall. Skywalker looked over to Kenobi as he lay unconscious on the ground. Please don‚Äôt be dead, he thought. His lightsaber ignited as he stared at Palpatine who got up and saw it was Anakin who did that. Like a bantha in headlights, Palpatine was shocked Skywalker would do such a thing. \nYOU WERE BEHIND THIS ENTIRE WAR. \nPLAYING BOTH SIDES.\nYOU WERE BEHIND THE ASSASSINATIONS ON PADME‚ÄôS LIFE\nYOU CONTROLLED DOOKU\nI‚Ä¶I trusted you.\n\nPalpatine didn‚Äôt know what to say, for the first time. He merely just looked at Anakin, then to the boy‚Äôs blue lightsaber. \nAre you going to kill me?\nSkywalker, stand down. You are too conflicted\nMace was shot back into Palpatine‚Äôs desk as it crumbled into pieces.\nAnakin didn‚Äôt even take his gaze off Palpatine.\nHe walked towards him as Palpatine summoned his saber from his hand, standing in the same spot, he ignited it like he had done moments before with the other Jedi, as they now laid scattered across the floor, lifeless, in pieces, like the desk. \nThe future master and apprentice locked sabers, as Palpatine taunted the boy. You are angry, Anakin, I can feel it. Use your emotions, forget what the Jedi taught you, they were holding you back. They lied to you.\n\nAs did you. Callously said Anakin.\nThey fought in a blaze of red and blue. Anakin was standing his groundbut he knew Palpatine wasn‚Äôt unleashing his full powers. Not yet. Skywalker turned and twirled the saber behind his back, when he suddenly realized Palpatine had vanished and appeared behind him, as he looked down to see a red blade of fire locked ontop of a green blade, as Master Yoda had saved Anakin from losing yet another limb.\nCheck on Kenobi, you must. Handle Sidious, I will.\n\nBut Master‚Ä¶\n\nYoda pushed the force out in both directions as Palpatine was sent back a few steps and Anakin was moved several meters. \n\nMaster. Master are you alright.\nObi-Wan lay in Anakin‚Äôs arms, as Skywalker placed his fingers around Kenobi‚Äôs forehead, sending energy and checking his vitals at the same time, jolting his brain to wake up.\nAs his looked at his master‚Äôs familiar blue eyes slowly open, Skywalker began to smile. \nKenobi looked at his padawan and softly said: Wh‚Ä¶what are you smiling at‚Ä¶did you lose your weapon again?\n\nI feel it was important to give Anakin Skywalker a happy ending in this one, for once. \n\nWhat did you think of this ending?\nThank you for your participation in the previous video's comments. I read many and was inspired by some of your conclusions.\n\nSee you in the next video!\n\n\nContinue the conversation on the Theory forums!\nhttps://starwarstheory.com/THEORY/posts\n\nBecome a Patron to support future content - https://www.patreon.com/StarWarsTheory\n\nJoin this channel to get access to perks:\nhttps://www.youtube.com/channel/UC8CbFnDTYkiVweaz8y9wd_Q/join",
